import { Route, Routes } from "react-router-dom";
import CelebretiesBox from "./components/CelebretiesBox";
import celebData from "./celebData";

function App() {
  return (
    <Routes>
      <Route
        path="/"
        element={
          <CelebretiesBox
            imageAdress={celebData[0].imageAdress}
            nameCeleb="Rihanna"
          />
        }
      />
    </Routes>
  );
}

export default App;
